direct\" title=\"1356\">1356<\/a>&#160;\u2014 \u0410\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0435 \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0430\u043c\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9F%D1%83%D0%B0%D1%82%D1%8C%D0%B5_(1356)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u0443\u0430\u0442\u044c\u0435 (1356)\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u041f\u0443\u0430\u0442\u044c\u0435<\/a>. \u041c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0440\u044b\u0446\u0430\u0440\u0435\u0439 \u0443\u0431\u0438\u0442\u043e, \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B0%D0%BD%D0%BD_II_%D0%94%D0%BE%D0%B1%D1%80%D1%8B%D0%B9\" class=\"mw-redirect\" title=\"\u0418\u043e\u0430\u043d\u043d II \u0414\u043e\u0431\u0440\u044b\u0439\">\u0418\u043e\u0430\u043d\u043d II \u0414\u043e\u0431\u0440\u044b\u0439<\/a> \u0432\u0437\u044f\u0442 \u0432 \u043f\u043b\u0435\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1618\" class=\"mw-redirect\" title=\"1618\">1618<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9F%D0%BB%D1%8C%D0%B7%D0%B5%D0%BD%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u043b\u044c\u0437\u0435\u043d\u0435\">\u043e\u0441\u0430\u0434\u044b \u041f\u043b\u044c\u0437\u0435\u043d\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1648\" class=\"mw-redirect\" title=\"1648\">1648<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B2%D0%B5%D0%B1%D0%B5%D0%BA\" title=\"\u041a\u0432\u0435\u0431\u0435\u043a\">\u041a\u0432\u0435\u0431\u0435\u043a\u0435<\/a> \u0416\u0430\u043a\