0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1841\" class=\"mw-redirect\" title=\"1841\">1841<\/a>&#160;\u2014 \u041f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B0%D1%81%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0442\u0440\u0430\u0441\u0431\u0443\u0440\u0433\">\u0421\u0442\u0440\u0430\u0441\u0431\u0443\u0440\u0433<\/a>-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B7%D0%B5%D0%BB%D1%8C\" title=\"\u0411\u0430\u0437\u0435\u043b\u044c\">\u0411\u0430\u0437\u0435\u043b\u044c<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863\" class=\"mw-redirect\" title=\"1863\">1863<\/a>&#160;\u2014 \u041f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B3,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0435\u0440\u0433, \u0424\u0451\u0434\u043e\u0440 \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u0433\u0440\u0430\u0444\u0430 \u0411\u0435\u0440\u0433\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_1863_%D0%B3%D0%BE%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 1863 \u0433\u043e\u0434\u0430\">\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 1863 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864\" class=\"mw-redirect\" title=\"1864\">1864<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u044b \u043e\u0442\u043a\u0438\u0434\u043d\u044b\u0435 \u0441\u0438\u0434\u0435\u043d\u044c\u044f \u043c\u0430\u0448\u0438\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888\" class=\"mw-redirect\" title=\"1888\">1888<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a> \u043d\u0430 \u043a\u0443\u0440\u043e\u0440\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0\" title=\"\u0421\u043f\u0430\">\u0421\u043f\u0430<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043a\u0440\u0430\u0441\u043e\u0442\u044b. \u0412 \u0444\u0438\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 21 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u0435\u043d\u0442\u043a\u0430 \u043d\u0430 \u0442\u0438\u0442\u0443\u043b \u00ab\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u044b \u043a\u0440\u0430\u0441\u043e\u0442\u044b\u00bb, \u0430 \u043e\u0442\u0431\u0438\u0440\u0430\u043b\u0438\u0441\u044c \u0434\u0435\u0432\u0443\u0448\u043a\u0438 \u0432 \u0444\u0438\u043d\u0430\u043b \u043f\u043e \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f\u043c, \u043f\u0440\u0438\u0441\u043b\u0430\u043d\u043d\u044b\u043c \u0432 \u0430\u0434\u0440\u0435\u0441 \u0436\u044e\u0440\u0438. \u041f\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f\u043c \u0440\u0435\u043f\u043e\u0440\u0442\u0451\u0440\u0430 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u043a\u0430\u043d\u0434\u0438\u043d\u0430\u0432\u0441\u043a\u0438\u0445 \u0433\u0430\u0437\u0435\u0442, \u043e\u0441\u0432\u0435\u0449\u0430\u0432\u0449\u0435\u0433\u043e \u0438\u0442\u043e\u0433\u0438 \u0442\u0435\u0445 \u043d\u0435\u043e\u0431\u044b\u0447\u043d\u044b\u0445 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u0439, \u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e \u0441\u043a\u0440\u043e\u043c\u043d\u043e. \u00ab\u0423\u0447\u0430\u0441\u0442\u043d\u0438\u0446\u044b \u043a\u043e\u043d\u043a\u0443\u0440\u0441\u0430 \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u043b\u0438 \u043e\u0441\u0442\u0430\u0432\u0430\u0442\u044c\u0441\u044f \u043d\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u043c\u0438 \u0448\u0438\u0440\u043e\u043a\u043e\u0439 \u043f\u0443\u0431\u043b\u0438\u043a\u0435, \u0436\u0438\u043b\u0438 \u0432 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e\u043c \u0434\u043e\u043c\u0435, \u0434\u043e\u0441\u0442\u0443\u043f \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u0437\u0430\u043a\u0440\u044b\u0442 \u0434\u043b\u044f \u043f\u043e\u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u0445, \u0430 \u043d\u0430 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f\u0445 \u043e\u043d\u0438 \u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u043b\u0438\u0441\u044c \u0432 \u0437\u0430\u043a\u0440\u044b\u0442\u043e\u043c \u044d\u043a\u0438\u043f\u0430\u0436\u0435\u00bb. \u041f\u0440\u0438\u0447\u0451\u043c \u0432\u0441\u0435 \u043c\u0443\u0436\u0447\u0438\u043d\u044b, \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0438\u0435 \u043d\u0430 \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u044f\u0445, \u0431\u044b\u043b\u0438 \u043e\u0434\u0435\u0442\u044b \u0432\u043e \u0444\u0440\u0430\u043a\u0438, \u0436\u0435\u043d\u0449\u0438\u043d\u044b&#160;\u2014 \u0432 \u0434\u043b\u0438\u043d\u043d